import React from 'react';
import { Link } from 'react-router-dom';

const MenuAmojs = () => {
  return (
    <div className="menu">
      <ul className="navbar-nav">
        <li className="nav-item">
          <Link to="/home" className="btn btn-outline-secondary">
          Menu principal</Link>
        </li>
      </ul>
    </div>
  );
};

export default MenuAmojs;
